import Video from './demo_vids/fainting.mp4';
import Poster from './demo_vids/fainting.png';
import Img from './images/fainting.png';
export const faint = {
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    headline: 'Fainting Detection',
    description:
      'This feature for our product detects fainting. In hospitals, if a person faints, he/she needs to be put on a stretcher/wheelchair and attended to immediately. Hence, if such an incident occurs, our product would immediately alert the attendings to proceed towards the fainted person.',
    imgStart: '',
    img: Img,
    alt: 'Credit Card',
    path: Video,
    poster: Poster
  };
